import { useEffect, useState } from "react";
const Home = () => {
  const [tourists, setTourists] = useState(null);
  useEffect(() => {
    const fetchTourists = async () => {
      const response = await fetch("http://localhost:4000/api/tourists");
      // array of tourists
      const json = await response.json();

      if (response.ok) {
        setTourists(json);
      }
    };

    fetchTourists();
  }, []);
  return (
    <div className="Home">
      {/* basically what this does is that it will only map if tourists is not null */}
      <div className="tourists">
        {tourists &&
          tourists.map((tourist) => (
            <p key={tourist._id}>{tourist.username}</p>
          ))}
      </div>
    </div>
  );
};

export default Home;
